def return_binary_or_hexa(nums):
    a = nums[40]
    b = nums[200]
    total = 0

    for i in range(a+1, b):
        if i not in nums[40:201]:
            total += i

    if total == 0:
        return ''

    if total % 2 == 1:
        return bin(total)[2:]
    else:
        return hex(total)[2:]
